/**
 * Expand a search term with its synonyms
 * @param {string} term - The term to expand
 * @returns {string[]} Array of the term plus all synonyms
 */
export function expandTerm(term) {
    const lower = term.toLowerCase().trim();
    const synonyms = MEDICAL_SYNONYMS[lower];
    if (synonyms) {
        return [lower, ...synonyms];
    }
    return [lower];
}

/**
 * Expand all terms in a search query
 * @param {string} query - The search query
 * @returns {string[]} All unique terms including expansions
 */
export function expandQuery(query) {
    const terms = query.toLowerCase().split(/\s+/).filter(t => t.length > 1);
    const expanded = new Set();

    terms.forEach(term => {
        expandTerm(term).forEach(t => expanded.add(t));
    });

    return Array.from(expanded);
}
